CREATE TABLE omnivore.discover_feed_articles (
    id uuid PRIMARY KEY,
    feed_id uuid NOT NULL REFERENCES omnivore.discover_feed(id) ON DELETE CASCADE,
    title text NOT NULL,
    slug text NOT NULL,
    description text,
    url text NOT NULL,
    author text,
    image text,
    published_at timestamptz NOT NULL DEFAULT current_timestamp,
    embedding vector(1536),
    UNIQUE(slug)
);

GRANT SELECT ON omnivore.discover_feed_articles TO omnivore_user;

CREATE TABLE omnivore.discover_feed_save_link (
   discover_article_id uuid NOT NULL REFERENCES omnivore.discover_feed_articles(id) ON DELETE CASCADE,
   user_id uuid NOT NULL REFERENCES omnivore.user(id) ON DELETE CASCADE,
   article_save_id uuid NOT NULL REFERENCES omnivore.library_item(id) ON DELETE CASCADE,
   article_save_url text,
   created_at timestamptz NOT NULL DEFAULT current_timestamp,
   deleted bool NOT NULL DEFAULT false,
   CONSTRAINT user_discover_feed_link UNIQUE(discover_article_id, user_id)
);

GRANT SELECT, INSERT, UPDATE, DELETE ON omnivore.discover_feed_save_link to omnivore_user;

CREATE TABLE omnivore.discover_feed_article_topic_link (
    discover_feed_article_id uuid NOT NULL REFERENCES omnivore.discover_feed_articles(id) ON DELETE CASCADE,
    discover_topic_name text NOT NULL REFERENCES omnivore.discover_topics(name) ON DELETE CASCADE,
    UNIQUE (discover_feed_article_id, discover_topic_name)
);

GRANT SELECT ON omnivore.discover_feed_article_topic_link to omnivore_user;

INSERT INTO omnivore.discover_feed (id, title, link, description, type) VALUES('dacd3088-aadb-11ee-bbfe-5f5fa18779ea', 'ArsTechnica - All', 'https://feeds.arstechnica.com/arstechnica/index', 'All Stories from Ars Technica', 'rss');
INSERT INTO omnivore.discover_feed (id, title, link, description, type) VALUES('405eb048-aadc-11ee-bbfe-ff801479b901', 'Wired', 'https://www.wired.com/feed/rss', 'The latest from www.wired.com', 'rss');


INSERT INTO omnivore.discover_feed_subscription(user_id, feed_id, visible_name)
SELECT id, 'dacd3088-aadb-11ee-bbfe-5f5fa18779ea', 'ArsTechnica'
FROM omnivore.user
ON CONFLICT DO NOTHING;


INSERT INTO omnivore.discover_feed_subscription(user_id, feed_id, visible_name)
SELECT id, '405eb048-aadc-11ee-bbfe-ff801479b901', 'Wired'
FROM omnivore.user
ON CONFLICT DO NOTHING;


BEGIN;

-- Create a trigger to Insert Default Feeds into Subscriptions on user create
CREATE OR REPLACE FUNCTION omnivore.create_discover_feed_subscription()
    RETURNS trigger AS $$
    BEGIN
        IF (NEW.status != 'DELETED') THEN
            INSERT INTO omnivore.discover_feed_subscription(user_id, feed_id, visible_name) VALUES(NEW.id, 'dacd3088-aadb-11ee-bbfe-5f5fa18779ea', 'ArsTechnica');
            INSERT INTO omnivore.discover_feed_subscription(user_id, feed_id, visible_name) VALUES(NEW.id, '405eb048-aadc-11ee-bbfe-ff801479b901', 'Wired');
        END IF;
        RETURN NEW;
    END;
$$ LANGUAGE plpgsql;

CREATE TRIGGER insert_discover_feed_new_user
    AFTER INSERT ON omnivore.user
    FOR EACH ROW EXECUTE PROCEDURE omnivore.create_discover_feed_subscription();

COMMIT;

CREATE INDEX IF NOT EXISTS save_to_article_idx ON omnivore.discover_feed_save_link(discover_article_id);
CREATE INDEX IF NOT EXISTS user_to_save_idx ON omnivore.discover_feed_save_link(user_id);
CREATE INDEX IF NOT EXISTS feed_sub_to_user_idx ON omnivore.discover_feed_subscription(user_id);
CREATE INDEX IF NOT EXISTS articles_to_feed_idx on omnivore.discover_feed_articles(feed_id);
CREATE INDEX IF NOT EXISTS topic_idx ON omnivore.discover_feed_article_topic_link(discover_topic_name);
CREATE INDEX IF NOT EXISTS published_at_sort_idx ON omnivore.discover_feed_articles(published_at);
